import MusicItem from "./MusicItem";

function MusicList({ musics, addToPlaylist }) {
  return (
    <div className="container">
      <h2>Music List</h2>

      <ul>
        {musics.map((music) => (
          <MusicItem
            key={music.id}
            music={music}
            addToPlaylist={addToPlaylist}
          />
        ))}
      </ul>
    </div>
  );
}

export default MusicList;
